import React, { useState } from 'react';
import './style.css';

function AddButton() {
  const [name, setName] = useState(0);
  const [arys, setArys] = useState([]);
  const logs = (number:number,arys:[])=>{
    setName(number+1);
    const arg3 = [...Array(name)].map((_,i) => i+1)
    setArys(Array.prototype.push.apply(arys, arg3))
    console.log(arys)
  }

  return (
    <div>
      <h2>増えるボタン</h2>
      {arys.map((counkey:number) => {
        return <div className="divbtn" onClick={logs()} key={counkey.toString()}>{name}</div>
      })}
    </div>
  );
}

export default AddButton;
